import {combineReducers} from "redux";
import {compositionsPageReducer} from "./compositionsPage";
import {homePageReducer} from "./homePage";
import {suggestPageReducer} from "./suggestPage";
import {userReducer} from "./user";

export const rootReducer = combineReducers({
    theme: 'dark',
    compositionsPage: compositionsPageReducer,
    homePage: homePageReducer,
    suggestPage: suggestPageReducer,
    user: userReducer,
})
